import React from 'react';
import './App.css';
import { Button } from '@material-ui/core'

class Test extends React.Component {
    handleClick = (e) => {
        console.log(e.target.name);
    }

    render() {
        return (
            <div>
                <Button name="1" align="left" variant="contained" onClick={this.handleClick}>Click me!</Button>
                <Button name="2" align="right" variant="contained" onClick={this.handleClick}>Click me!</Button>
            </div>
        );
    }
}

export default Test;
